import React, { useState } from "react";

function Login(){
    const[username, setUsername] = useState("");
    const[password, setPassword] = useState("");


    function submitData(e){
        e.preventDefault();
    }
    function validateData(){
        username.length < 3 ? "Length too Short" : "";
        password.length < 3 ? "Length too Short" : "";
    }
    return(
        <div>
            <h1>Login</h1>
            <form onSubmit={submitData}>
                <input type="text" placeholder="Enter username" onChange={validateData}/>
                <br /><br />
                <input type="text" placeholder="Enter Pass" onChange={validateData}/>
                <br /><br />
                <button>Submit</button>
            </form>
        </div>
    )
}
export default Login;
